import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';

const PatientDetails = () => {
    const { numero_atendimento } = useParams();
    const [patientData, setPatientData] = useState(null);

    useEffect(() => {
        const fetchPatientData = async () => {
            try {
                const response = await fetch(`http://127.0.0.1:8000/api/pacientes/${numero_atendimento}`);
                if (response.ok) {
                    const data = await response.json();
                    setPatientData(data);
                } else {
                    console.error('Failed to fetch patient data');
                }
            } catch (error) {
                console.error('Error:', error);
            }
        };

        fetchPatientData();
    }, [numero_atendimento]);

    return (
        <div style={{ padding: '20px' }}>
            <h1>Patient Details</h1>
            {patientData ? (
                <div>
                    <p><strong>Numero Atendimento:</strong> {patientData.numero_atendimento}</p>
                    <p><strong>Nome Completo:</strong> {patientData.nome_completo}</p>
                    <p><strong>Sexo:</strong> {patientData.sexo}</p>
                    <p><strong>Email:</strong> {patientData.email}</p>
                    <p><strong>Celular:</strong> {patientData.celular}</p>
                    {/* Adicione aqui a lógica para exibir os exames, se necessário */}
                </div>
            ) : (
                <p>Loading...</p>
            )}
        </div>
    );
};

export default PatientDetails;
